这是一个简单的Python实现的四则运算计算器：

```python
def calculator():
    while True:
        operation = input("请输入你要进行的运算（+ - * /），或输入'quit'退出：")
        if operation.lower() == 'quit':
            break
        num1 = float(input("请输入第一个数字："))
        num2 = float(input("请输入第二个数字："))
        if operation == '+':
            result = num1 + num2
        elif operation == '-':
            result = num1 - num2
        elif operation == '*':
            result = num1 * num2
        elif operation == '/':
            if num2 != 0:
                result = num1 / num2
            else:
                print("错误：除数不能为0")
                continue
        else:
            print("错误：无效的操作符")
            continue
        print(f"{num1} {operation} {num2} = {result}")

calculator()
```

这个程序会一直运行，直到你选择'quit'。它会要求用户输入两个数字和一个运算符，然后做相应的计算并打印结果。注意，对于除法操作，它会检查除数是否为0，以防止发生除以零的错误。
